import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Pravesh from "./Pravesh";

class App extends React.Component {
  constructor(props) {
    super(props);
    console.log(props);
  }

  render() {
    return this.greet();
  }
}

export default App;
